void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy;

    float f = pow(mod(abs(sin(uv.x * 2.0 + 0.6)), pow(abs(4.0 * (uv.y - 0.5)), 0.1)), 0.6);
    float n = pow(mod(abs(sin(uv.x * 2.0 + 0.6)), pow(abs(2.5 * (uv.y - 0.5)), 0.1)), 0.4);

    float g = 2. + 0.1 * sin(iTime + sin(iTime) * 3.);
    fragColor = vec4(1.0 - n - pow(f * g, 9.), 0., 0. ,1.0);
}
